import React from 'react';
import Cards from './Cards';
import Sdata from './Sdata';

function CardInfra() {
    function allAPIJson(val) {
        <Cards imgSrc= {val.imgSrc} 
            title={val.title} 
            sname={val.sname} 
            link={val.link}
        />
    }
    return(
        <>       
        <h1 className="heading_style">Top list of Netflix Series</h1>
        <div className="contentWrapper">

            {/* <Cards imgSrc= {Sdata[1].imgSrc} 
            title={Sdata[1].title} 
            sname={Sdata[1].sname} 
            link={Sdata[1].link}
            />
            <Cards imgSrc= {Sdata[2].imgSrc} 
            title={Sdata[2].title} 
            sname={Sdata[2].sname} 
            link={Sdata[2].link}
            /> */}
            {Sdata.map(allAPIJson)}
            </div>
        </>

    )

} export default CardInfra;
